import React from "react";
import {Link} from "react-router-dom";

const Navigation = () =>{
    return(
        <>
            <section className="main-navigation-section">
                <div className="menu">
                    <ul>
                        <li><Link className="link-style">CATEGORY</Link></li>
                        <li><Link className="link-style" to="/">Home</Link></li>
                        <li><Link className="link-style" to="/about">About</Link></li>
                        <li><Link className="link-style" to="/services">services</Link></li>
                        <li><Link className="link-style" to="/contact">contact</Link></li>
                    </ul>
                </div>
            </section>
        </>
    );
}
export default Navigation;
